const initialState = {
  msg: "Life is good",
  todos: [
    {
      _id: 123,
      title: "Buy milk"
    },
    {
      _id: 234,
      title: "Walk dogs"
    }
  ]
}

const fsm = (state = initialState, action) => {
  return state
}

export default fsm
